import './calcResults.css';
import React from 'react';
import PropTypes from 'prop-types';
import { Component } from 'react';
import { withStyles } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Typography from '@mui/material/Typography';

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box sx={{ p: 3 }}>
          <Typography component={'div'}>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.number.isRequired,
  value: PropTypes.number.isRequired,
};

function a11yProps(index) {
  return {
    id: `simple-tab-${index}`,
    'aria-controls': `simple-tabpanel-${index}`,
  };
}

export default function CalcResults() {
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

    return (
      <Box sx={{ width: '100%', flexGrow: 1, bgcolor: 'background.paper' }}>
      <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
        <Tabs value={value} onChange={handleChange} aria-label="basic tabs example">
          <Tab label="Actual Vs. Average ROR" {...a11yProps(0)} />
          <Tab label="Stocks" {...a11yProps(1)} />
          <Tab label="Bonds" {...a11yProps(2)} />
          <Tab label="3-Yr. Treasuries" {...a11yProps(3)} />
          <Tab label='"Black Box" Planning' {...a11yProps(4)} />
        </Tabs>
      </Box>
      <TabPanel value={value} index={0}>
        <div className="calwrapper act-vs-avg">
            <div className="caloutput">
              Loading Data...
            </div>
        </div>
      </TabPanel>
      <TabPanel value={value} index={1}>
        <div className="calwrapper stocks">
            <div className="caloutput">
              Loading Data...
            </div>
        </div>
      </TabPanel>
      <TabPanel value={value} index={2}>
      <div className="calwrapper bonds">
          <div className="caloutput">
            Loading Data...
          </div>
      </div>
      </TabPanel>
      <TabPanel value={value} index={3}>
        <div className="calwrapper treasuries">
            <div className="caloutput">
              Loading Data...
            </div>
        </div>
      </TabPanel>
      <TabPanel value={value} index={4}>
      <div className="calwrapper black-box">
          <div className="caloutput">
            Loading Data...
          </div>
      </div>
      </TabPanel>
      </Box>
    )
}
